import card2 from "../images/2.jpg";
import card3 from "../images/3.jpg";
import card4 from "../images/5.jpg";
import "../main.css";
import Card from "./Card";

const Cards = () => {
  return (
    <div className="container">
      <div className="row">
        <Router>
          <Card />
        </Router>
      </div>
    </div>
  );
};

export default Cards;
